custom.scss:
/* custom css by Ryan McCoy - fewtr.com */

/* jam project */

.jam, img {
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  -o-user-select: none;
  user-select: none;
}

.nopoint {
  pointer-events: none;
}
